import React from 'react'
import './Footer.css'

const Footer = () => {
  return (
      <div className='footer'>
        <p className='for-p'>College Website:  <a className='for-a' href="https://svuce.edu.in">https://svuce.edu.in</a></p>
      </div>
  )
}

export default Footer
